import { styled } from "styled-components"

const Container = styled.div`
    width: 100vw;
    height: 100vh;
    background: linear-gradient(
        rgba(255, 255, 255, 0.5),
        rgba(255, 255, 255, 0.5)), 
        url("https://www.toddsnyder.com/cdn/shop/files/JulyStyleGuideBB_1600x.png?v=1687795267")center;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Wrapper  = styled.div`
    width: 40%;
    padding: 20px;
    background-color: white;

`;

const Title = styled.h1`
    font-size: 24px;
    font-weight: 300;
`;

const Form = styled.form`
    display: flex;
    flex-wrap: wrap;
`;

const Input = styled.input`
    flex: 1;
    min-width: 40%;
    margin: 20px 10px 
`;

const Agreement  = styled.span``;

const Button = styled.button``;



export const Register = () => {
  return (
    <Container>
        <Wrapper>
            <Title> CREATE AN ACCOUNT </Title>
            <Form>
                <Input placeholder = "name"/>
                <Input placeholder = "last name"/>
                <Input placeholder = "username"/>
                <Input placeholder = "email"/>
                <Input placeholder = "password"/>
                <Input placeholder = "confirm password"/>
                <Agreement>
                    By creating an account, I consent to the processing of my personal data in accordance
                    with the <b> PRIVACY POLICY </b>
                </Agreement>
                <Button>CREATE</Button>
            </Form>
        </Wrapper>
    </Container>
  )
}
